import { AppBar, Box, Container, Grid, Toolbar, Typography } from "@mui/material";
import Cards from "../../components/Cards";

const Home = () => {
  return (
    <>
    <Box sx={{display: "flex"}}>
    <AppBar position="fixed" children={
        <Toolbar>
            <Typography variant="h6" component="div">
                CRUD App
            </Typography>
        </Toolbar>
    } />
    <Box component={"main"} sx={{width:"100%"}} >

    <Toolbar />
    <Container maxWidth={false} sx={{ mt: 4, mb: 4 }} >
        <Grid  container columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
            <Grid item xs={6} alignContent={"center"}>
                <Cards 
                    title={"Psycopg2"}
                    description={"Click this card to play around with the DB using Psycopg2 package."}
                />
            </Grid>
            <Grid item xs={6}>
                <Cards 
                    title={"SQLAlchemy"}
                    description={"Click this card to play around with the DB using SQLAlchemy package."}
                />
            </Grid>
        </Grid>
    </Container>
    </Box>
    </Box>

    </>
  )  
};

export default Home;
